drop database if exists bill_system;
create database bill_system;
use bill_system;

create table bill (
	bill_number INT,
	bill_name VARCHAR(50),
	date_passed DATE,
	status VARCHAR(50),
	legal_history VARCHAR(50),
	date_filed DATE,
	constraint bill_number_pk primary key(bill_number)
);

create table senator (
	senator_id INT AUTO_INCREMENT,
	senator_name VARCHAR(50),
	senator_bill_number INT,
	email VARCHAR(50),
	date_elected DATE,
	position VARCHAR(50),
	constraint senator_senator_id_pk primary key(senator_id), 
	constraint bill_fk foreign key(senator_bill_number) references bill(bill_number)
);
create table house_member (
	house_member_id INT AUTO_INCREMENT,
	house_member_name VARCHAR(50),
	house_member_bill_number INT,
	email VARCHAR(50),
	date_elected DATE,
	position VARCHAR(50),
	constraint house_member_house_member_id_pk primary key(house_member_id), 
	constraint bill_fk2 foreign key(house_member_bill_number) references bill(bill_number)
);
